terms2 = [] # A list containing all sentiment-carrying 2-word terms. 
twoWord_scores = {}
terms3 = [] # A list containing all sentiment-carrying 3-word terms.
threeWord_scores = {}





#
# Creates the 1-word, 2-word and 3-word score dictionaries.
# @input:
#     s is a connection to the sentiment file.
# 
def sent_dict(s):
    
    sfile = s.readlines()
    for line in sfile: 
        term, score  = line.split("\t")  # The file is tab-delimited.
        terms.append(term)
        scores[term] = int(score)  # Converts the score to an integer.
        
        if ' ' in term:
            twoWord_scores[term] = int(score)
            terms2.append(term)
        else:
            oneWord_scores[term] = int(score)
            terms1.append(term)
            
            
    remv = []
    for key in twoWord_scores:
        if len(key.split(' ')) > 2:
            threeWord_scores[key] = twoWord_scores[key]
            terms3.append(key)
            remv.append(key)

    for key in remv:
        del twoWord_scores[key]
        terms2.remove(key)




#
# Removes all the punctuations and extra spaces in the text.
# @input:
#     text is the text whose punctuations and extra spaces are to be removed.
# @ return:
#     split_text is a list containing only the words in the original text.
#
def scrub_text(text):
    value1 = text.lower()
    value2 = value1.replace('!',' ')
    value3 = value2.replace('?',' ')
    value4 = value3.replace(',',' ')
    value5 = value4.replace('.',' ')
    value6 = value5.replace(':',' ')
    value7 = value6.replace(';',' ')
    value8 = value7.replace('-',' ')
    clean_text = value8.strip()
    split_text1 = clean_text.split(' ')
    split_text = []
    for x in split_text1:
        if not x == '':
            split_text.append(x)
    return split_text        
    
    
    
    

#
# Computes the total sentiment score from the list of terms.
# @input:
#     lst is a list of terms whose sentiment scores are to be summed.
# @return:
#     total is the total sentiment score from the list of terms.
#
def sent_score(lst):
    split_tweet = lst
    total = 0 # Score of a tweet.            
    # Searches for the 3-word terms
    n = len(split_tweet)
    remained = []   
    span = 3
    start = 0
    while start <= n-span :
        space = ' '
        seq = (split_tweet[start],split_tweet[start+1],split_tweet[start+2])
        phrase = space.join(seq)
        if phrase in terms3:
            total += threeWord_scores[phrase]
            start += span
        else:
            remained.append(split_tweet[start])
            start += 1
    else:
        while start < n:
            remained.append(split_tweet[start])
            start += 1
            
    # Searches for the 2-word terms
    split_tweet = remained
    n = len(split_tweet)
    remained = []                         
    span = 2
    start = 0            
    while start <= n-span :
        space = ' '
        seq = (split_tweet[start],split_tweet[start+1])
        phrase = space.join(seq)
        if phrase in terms2:
            total += twoWord_scores[phrase]
            start += span
        else:
            remained.append(split_tweet[start])
            start += 1
    else:
        while start < n:
            remained.append(split_tweet[start])
            start += 1
            
    # Searches for the 1-word terms
    split_tweet = remained
    n = len(split_tweet)
    remained = []                         
    span = 1
    start = 0            
    while start <= n-span :
        phrase = split_tweet[start]
        if phrase in terms1:
            total += oneWord_scores[phrase]
            start += span
        else:
            remained.append(split_tweet[start])
            start += 1
    else:
        while start < n:
            remained.append(split_tweet[start])
            start += 1

    return total
    
    
    
    
    
#
# Computes the coordinates of the center of the convex hull having a given 
# set of vertices.
# @input:
#     pts is a list if coordinates of vertices.
# @return:
#     coordinates of the center of the convex hull.
#
def center(pts):
    if len(pts) < 4:
        return pts
    p1 = pts[0]
    p2 = pts[2]
    x1 = p1[0]
    y1 = p1[1]
    x2 = p2[0]
    y2 = p2[1]
    
    return [(x1+x2)/2, (y1+y2)/2] 





